import React, { useRef } from 'react';
import {Col, Row} from'antd'
import './header.css';
import { NavLink, Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';

export const Header = () => {

  return (
    <>
    <div>
      <Row>
        <Col span={8}>COL-8</Col>
        <Col span={8}>COL-8</Col>
        <Col span={8}>COL-8</Col>
      </Row>
    </div>

    </>
   
  );
};
